','Texts for the Commemorative Office of the Virgin Mary and notated Office of the Dead','<?xml version=\'1.0\' encoding=\'UTF-8\'?>\n<TEI xmlns=\"http://www.tei-c.org/ns/1.0\">\n  <teiHeader>\n    <fileDesc>\n      <titleStmt>\n        <title>Description of University of Pennsylvania Ms. Codex 1589: Texts for the Commemorative Office of the Virgin Mary and notated Office of the Dead</title>\n      </titleStmt>\n      <publicationStmt>\n        <publisher>The University of Pennsylvania Libraries</publisher>\n        <availability>\n          <licence target=\"http://creativecommons.org/licenses/by/4.0/legalcode\">\n                                This description is Â©2015 University of\n                                Pennsylvania Libraries. It is licensed under a Creative Commons\n                                Attribution License version 4.0 (CC-BY-4.0\n                                https://creativecommons.org/licenses/by/4.0/legalcode. For a\n                                description of the terms of use see the Creative Commons Deed\n                                https://creativecommons.org/licenses/by/4.0/. </licence>\n          <licence target=\"http://creativecommons.org/publicdomain/mark/1.0/\"> All\n                                referenced images and their content are free of known copyright\n                                restrictions and in the public domain. See the Creative Commons\n                                Public Domain Mark page for usage details,\n                                http://creativecommons.org/publicdomain/mark/1.0/. </licence>\n        </availability>\n      </publicationStmt>\n      <notesStmt>\n        <note>Ms. codex.</note>\n        <note>Title supplied by cataloger.</note>\n        <note>Music: Contains Hufnagelschrift notation on 5-line staves in the Office of the Dead (f. 97r-107v), with later additions in square notation on 4-line staves (f. 108r-108v).</note>\n      </notesStmt>\n      <sourceDesc>\n        <msDesc>\n          <msIdentifier>\n            <settlement>Philadelphia</settlement>\n            <institution>University of Pennsylvania</institution>\n            <repository>Rare Book &amp; Manuscript Library</repository>\n            <idno type=\"call-number\">Ms. Codex 1589</idno>\n            <altIdentifier type=\"bibid\">\n              <idno>4936653</idno>\n            </altIdentifier>\n            <altIdentifier type=\"resource\">\n              <idno>http://hdl.library.upenn.edu/1017/d/medren/4936653</idno>\n            </altIdentifier>\n          </msIdentifier>\n          <msContents>\n            <summary>Benedictine manuscript containing texts for Matins and Lauds from the Commemorative Office of the Virgin. This version of the Office was said most often on Saturday in place of the usual Office of the day. Also contains the Office of the Dead accompanied by musical notation for the chants. The manuscript once had leather finding tabs flush to the edge of the leaves, all but one (f. 96) of which have been torn out (for example, f. 1, 7, 69).</summary>\n            <textLang>Latin</textLang>\n            <msItem>\n              <title>Texts for the Commemorative Office of the Virgin Mary and notated Office of the Dead</title>\n              <author>Catholic Church</author>\n              <respStmt>\n                <resp>scribe</resp>\n                <persName>Keysser, Georg</persName>\n              </respStmt>\n            </msItem>\n            <msItem n=\"2r\">\n              <locus>2r</locus>\n              <title>Antiphona et responsoria et lectiones de commune beate Marie semper virginis..., f. 2r</title>\n            </msItem>\n            <msItem n=\"54v\">\n              <locus>54v</locus>\n              <title>Lectiones infra tricesimum [assumptionis] beate Mariae semper virginis, f. 54v</title>\n            </msItem>\n            <msItem n=\"70r\">\n              <locus>70r</locus>\n              <title>De commune beatae mariae semper virginis post octavas epiphaniae usque ad purificationem, f. 70r</title>\n            </msItem>\n            <msItem n=\"84v\">\n              <locus>84v</locus>\n              <title>Psalmos omnes tam ad mattutinas quam ad laudes, ymnos, cantica, Te Deum laudamus, omnia secundum ordinem, f. 84v</title>\n            </msItem>\n            <msItem n=\"97r\">\n              <locus>97r</locus>\n              <title>Kyrie eleison, f. 97r</title>\n            </msItem>\n            <msItem n=\"97v\">\n              <locus>97v</locus>\n              <title>Antiphona ad Placebo, ad vigilias, et ad laudes, una cum responsoriis Officium pro defunctis, f. 97v</title>\n            </msItem>\n            <msItem n=\"108r\">\n              <locus>108r</locus>\n              <title>In die depositionis ingrediendo ecclesia, f. 108r</title>\n            </msItem>\n          </msContents>\n          <physDesc>\n            <objectDesc>\n              <supportDesc material=\"paper\">\n                <support>\n                  <p>paper</p>\n                </support>\n                <extent>131 leaves : 204 x 140 (166 x 107) mm. bound to 205 x 145 mm</extent>\n                <collation>\n                  <p>Paper, 131; 1â¶(-1) 2Â¹â° 3â¶ 4Â¹â° 5â¶ 6Â¹â° 7-9â¶ 10Â¹â°(-1) 11-13â¸ 14â¸(+1) 15â¸(-2) 16Â¹â° 17â¸; contemporary foliation in red ink, upper center recto, 1-5, 7, 6, 8-53, 53--66, [67], 68-76, 78-94, [i], 95-96 (=f. 2-98); modern foliation in pencil, [v, 1-126], upper right recto. References in this record are to modern foliation. Catchwords on almost every page, lower right recto or verso.</p>\n                </collation>\n              </supportDesc>\n              <layoutDesc>\n                <layout>Written in 2 columns of 27 lines (f. 2r-95v) and 2 columns of 6 staves (f. 97v-107v); frame-ruled in red ink with text ruled in lead.</layout>\n              </layoutDesc>\n            </objectDesc>\n            <scriptDesc>\n              <scriptNote>Written in a German Gothic script by Georg Keysser (f. 96r).</scriptNote>\n            </scriptDesc>\n            <decoDesc>\n              <decoNote>3 full-page borders in colored inks with architectural columns (f. 1v, 54v, 69v); 5-line initial and full scrollwork border in colored inks (f. 2r); 8-line initial in colored inks and first words in display uncials in red ink (f. 84v); 2-line initial in 2 colors and knotwork design in colored inks (f. 96r); 1- to 3-line initials in various colors throughout; rubrication, foliation, and frame-ruling in red ink.</decoNote>\n              <decoNote n=\"1v\">Decorated border, f. 1v</decoNote>\n              <decoNote n=\"2r\">Decorated border, f. 2r</decoNote>\n              <decoNote n=\"2r\">Decorated initial, Initial I, f. 2r</decoNote>\n              <decoNote n=\"4r\">Decorated initial, Initial P, f. 4r</decoNote>\n              <decoNote n=\"4r\">Decorated initial, Initial A, f. 4r</decoNote>\n              <decoNote n=\"4v\">Decorated initial, Initial A, f. 4v</decoNote>\n              <decoNote n=\"4v\">Decorated initial, Initial S, f. 4v</decoNote>\n              <decoNote n=\"4v\">Decorated initial, Initial A, f. 4v</decoNote>\n              <decoNote n=\"7r\">Decorated initial, Initial S, f. 7r</decoNote>\n              <decoNote n=\"9v\">Decorated initial, Initial S, f. 9v</decoNote>\n              <decoNote n=\"12r\">Decorated initial, Initial D, f. 12r</decoNote>\n              <decoNote n=\"14v\">Decorated initial, Initial B, f. 14v</decoNote>\n              <decoNote n=\"17r\">Decorated initial, Initial D, f. 17r</decoNote>\n              <decoNote n=\"19v\">Decorated initial, Initial E, f. 19v</decoNote>\n              <decoNote n=\"22r\">Decorated initial, Initial A, f. 22r</decoNote>\n              <decoNote n=\"22r\">Decorated initial, Initial N, f. 22v</decoNote>\n              <decoNote n=\"24v\">Decorated initial, Initial S, f. 24v</decoNote>\n              <decoNote n=\"27r\">Decorated initial, Initial B, f. 27r</de