p://creativecommons.org/licenses/by/4.0/legalcode\">\n                                This description is Â©2015 University of\n                                Pennsylvania Libraries. It is licensed under a Creative Commons\n                                Attribution License version 4.0 (CC-BY-4.0\n                                https://creativecommons.org/licenses/by/4.0/legalcode. For a\n                                description of the terms of use see the Creative Commons Deed\n                                https://creativecommons.org/licenses/by/4.0/. </licence>\n          <licence target=\"http://creativecommons.org/publicdomain/mark/1.0/\"> All\n                                referenced images and their content are free of known copyright\n                                restrictions and in the public domain. See the Creative Commons\n                                Public Domain Mark page for usage details,\n                                http://creativecommons.org/publicdomain/mark/1.0/. </licence>\n        </availability>\n      </publicationStmt>\n      <notesStmt>\n        <note>Ms. roll.</note>\n        <note>Title from outer label. Translated as \"An illustrated guide to Western ships.\"</note>\n        <note>Caption title from first preface.</note>\n        <note>Roll has additional textual content after final image with title \"Suisengun kontairyaku kibun.\"</note>\n      </notesStmt>\n      <sourceDesc>\n        <msDesc>\n          <msIdentifier>\n            <settlement>Philadelphia</settlement>\n            <institution>University of Pennsylvania</institution>\n            <repository>Rare Book &amp; Manuscript Library</repository>\n            <idno type=\"call-number\">LJS 454</idno>\n            <altIdentifier type=\"bibid\">\n              <idno>6016920</idno>\n            </altIdentifier>\n            <altIdentifier type=\"resource\">\n              <idno>http://hdl.library.upenn.edu/1017/d/medren/6016920</idno>\n            </altIdentifier>\n          </msIdentifier>\n          <msContents>\n            <summary>Scroll of diagrams and text concerning the construction and compartmentalization of European ships, referred to as battleships, all on the recto side. At the top of the scroll is a thin piece of wood and a tie that wraps around the scroll; a paper label in Japanese is on the verso of the beginning of the scroll. Sheets of a different kind of paper, of the same width but different length, are used for backing.</summary>\n            <textLang mainLang=\"jpn\">Japanese</textLang>\n            <msItem>\n              <title>SeiyoÌ„ senpaku zukai</title>\n              <respStmt>\n                <resp>translator</resp>\n                <persName>Motoki, ShoÌ„ei, 1767-1822</persName>\n              </respStmt>\n            </msItem>\n          </msContents>\n          <physDesc>\n            <objectDesc>\n              <supportDesc material=\"paper\">\n                <support>\n                  <p>paper</p>\n                </support>\n                <extent>1 roll (34 sheets) : 37 x 894 cm</extent>\n              </supportDesc>\n              <layoutDesc>\n                <layout>Written in vertical columns of characters perpendicular to the length of the scroll.</layout>\n              </layoutDesc>\n            </objectDesc>\n            <scriptDesc>\n              <scriptNote>Written in Japanese script.</scriptNote>\n            </scriptDesc>\n            <decoDesc>\n              <decoNote>4 detailed full side diagrams of ships, 1 with a top pennant that unfolds above the upper edge of the scroll and 1 with a damaged foldout top pennant; 22 partial diagrams, including ship cross-sections and diagrams of astronomical and navigational equipment; many diagrams rubricated in red, some with syllables that are keyed to text describing the parts or areas of a ship.</decoNote>\n              <decoNote n=\"Closed scroll\">Scroll label, Closed scroll</decoNote>\n              <decoNote n=\"Opening 13\">Full ship diagram, Opening 13</decoNote>\n              <decoNote n=\"Opening 14\">Partial ship diagram, Opening 14</decoNote>\n              <decoNote n=\"Opening 15\">Full ship diagram, Opening 15</decoNote>\n              <decoNote n=\"Opening 16\">Partial ship diagram, Opening 16</decoNote>\n              <decoNote n=\"Opening 17\">Cross-section diagram, Opening 17</decoNote>\n              <decoNote n=\"Opening 18\">Small partial diagrams, Opening 18</decoNote>\n              <decoNote n=\"Opening 19\">Small partial diagrams, Opening 19</decoNote>\n              <decoNote n=\"Opening 20\">Small partial diagrams, Opening 20</decoNote>\n              <decoNote n=\"Opening 21\">Navigational instruments, Opening 21</decoNote>\n              <decoNote n=\"Opening 23\">Full ship diagram, Opening 23</decoNote>\n              <decoNote n=\"Opening 24\">Full ship diagram, Opening 24</decoNote>\n            </decoDesc>\n          </physDesc>\n          <history>\n            <origin>\n              <p>Written in Nagasaki, circa 1800.</p>\n              <origDate>after 1808</origDate>\n              <origPlace>Nagasaki, Japan</origPlace>\n            </origin>\n            <provenance>Sold by Sam Fogg Ltd. (London) to Lawrence J. Schoenberg, 1999.</provenance>\n            <provenance>Deposit by Lawrence J. Schoenberg and Barbara Brizdle, 2013.</provenance>\n          </history>\n        </msDesc>\n      </sourceDesc>\n    </fileDesc>\n    <profileDesc>\n      <textClass>\n        <keywords n=\"subjects\">\n          <term>Merchant ships--History</term>\n          <term>Warships--History</term>\n          <term>Naval architecture--History</term>\n          <term>Astronomical instruments--Early works to 1800</term>\n        </keywords>\n        <keywords n=\"form/genre\">\n          <term>Diagrams</term>\n          <term>Scrolls (information artifacts)</term>\n          <term>Manuscripts, Japanese--18th century</term>\n          <term>Manuscripts, Japanese--19th 